using System;
using System.Collections.Generic;
using System.Linq;
using System.Web;
using System.Web.UI;
using System.Web.UI.WebControls;
using Newtonsoft.Json;
using Newtonsoft.Json.Linq;

namespace Strikethrough.Developers
{
    public partial class DynamicJsonNet : System.Web.UI.Page
    {
        protected void Page_Load(object sender, EventArgs e)
        {
            string json = "{ \"canvas1\": \"data:image/png;base64,\", \"canvas2\": \"data:image/png;base64,\", \"canvas3\": \"data:image/png;base64,\", \"canvas4\": \"data:image/png;base64,\" }";
            JObject o = (JObject)JsonConvert.DeserializeObject(json);
            int count = o.Count;

            IList<string> keys = o.Properties().Select(p => p.Name).ToList();

            Label1.Text = "There are " + keys.Count.ToString() + " keys.<br />";
            for (int i = 0; i < keys.Count; i++)
            {
                Label1.Text += "key " + i.ToString() + ": " + keys[i] + "<br />";
            }
            Label1.Text += "<br />Each key has these values:<br />";
            for (int i = 0; i < keys.Count; i++)
            {
                Label1.Text += "value " + i.ToString() + ": " + o[keys[i]] + "<br />";
            }
        }
    }
}